import React from "react";
import '../../App.css';

function Home() {
  return (
    <>
      <div className="App">
        <header className="App-header">
          <h1>Firma</h1>
        </header>
      </div>
      <div>
        <button>Setor</button>
      </div>
    </>
  )
}
export default Home;
